As Faces do Templo de Bayo 
O principal destaque do templo são as torres nas quais estão esculpidas faces de pedra. Quatro rostos foram esculpidos em cada torre. Os arquitetos os organizaram de forma que olhassem em direções diferentes. Outro fato interessante é que os rostos mudam de humor durante o dia. É porque a luz que incide sobre eles em ângulos diferentes. Como resultado, se você os observar o dia todo, eles podem ser bons e maus. De vez em quando, eles riem e, de vez em quando, ficam tristes. Às vezes até assustam os turistas que andam pelo templo.

